void SelectButton::paintButton (Graphics& g, bool isMouseOverButton, bool isButtonDown)
{
    if ((getToggleState()  || isDown()))
    {
        g.setColour (Colours::black);
        g.drawImage (internalCachedImage2,
                     0, 0, 28, 25,
                     0, 0, internalCachedImage2->getWidth(), internalCachedImage2->getHeight());
		
    }
    else
    {
        g.setColour (Colours::black);
        g.drawImageWithin (internalCachedImage1,
                           0, 0, 28, 25,
                           RectanglePlacement::centred | RectanglePlacement::onlyReduceInSize,
                           false);
    }
	
	
}





